import { Component } from '@angular/core';
import { MatButtonModule } from '@angular/material/button';
import { MatCardModule } from '@angular/material/card';
import { House } from 'src/app/model/house';

@Component({
  selector: 'app-result-house',
  templateUrl: './result-house.component.html',
  styleUrls: ['./result-house.component.scss'],
  standalone: true,
  imports: [MatCardModule, MatButtonModule],
})
export class ResultHouseComponent {

  public house!: House;

  onInit() {
    this.house.realEstate = "Diferencial";
    this.house.code = "123";
    this.house.image = "https://s3.imoview.com.br/diferencial/Imoveis/4608/7qmyz-whatsapp-image-2023-07-06-at-101040-1688650847.jpeg";
  }

}
<mat-card class="example-card">
  <mat-card-header>
    <div mat-card-avatar class="example-header-image"></div>
    <mat-card-title>{{house.realEstate}}</mat-card-title>
    <mat-card-subtitle>Dog Breed</mat-card-subtitle>
  </mat-card-header>
  <img
    mat-card-image
    src={{house.image}}
    alt="Photo of a House"
  />
  <mat-card-content>
    <p>
      {{house.code}}
    </p>
  </mat-card-content>
  <mat-card-actions>
    <button mat-button>LIKE</button>
    <button mat-button>SHARE</button>
  </mat-card-actions>
</mat-card>
